import logo from './logo.svg';
import './App.css';
import {useState} from 'react';

const pieces = [1, 2, 3, 4, 5, 6, 7, 8, 9];

function App() {
  const [topLeft, setTopLeft] = useState(1);
  const [top, setTop] = useState(2);
  const [topRight, setTopRight] = useState(3);
  const [middleLeft, setMiddleLeft] = useState(4);
  const [middle, setMiddle] = useState(5);
  const [middleRight, setMiddleRight] = useState(6);
  const [bottomLeft, setBottomLeft] = useState(7);
  const [bottom, setBottom] = useState(8);
  const [bottomRight, setBottomRight] = useState(9);
  return (
    <>
      <div>
        <table>
          <tr>
            <td key="1">{topLeft}</td>
            <td key="2">{top}</td>
            <td key="3">{topRight}</td>
          </tr>
          <tr>
            <td key="4">{middleLeft}</td>
            <td key="5">{middle}</td>
            <td key="6">{middleRight}</td>
          </tr>
          <tr>
            <td key="7">{bottomLeft}</td>
            <td key="8">{bottom}</td>
            <td key="9">{bottomRight}</td>
          </tr>
      </table>
      <div>
        {pieces.map((piece) => {
          return <article>{piece}</article>
        })}
      </div>
      </div>
    </>
  );
}

export default App;
